	.SYNOPSIS
	Invoke-ADEnum | Author: Rob LP (@L3o4j)
 	https://github.com/Leo4j/Invoke-ADEnum
	
	.DESCRIPTION
	Automate Active Directory Enumeration
	
	#>
	
