		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $NoLAPS,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $LAPSComputers,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $NoAppLocker,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $NoVulnCertTemplates,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $DomainOUs,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $Force,
        
        [Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $UserCreatedObjects,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $AllGroups,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $TargetsOnly,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $Debugging,
		
		[Parameter (Mandatory=$False, ValueFromPipeline=$true)]
        [Switch]
        $NoClear,
		
